import './card.css';
function Card({url, title, description, price}) {
    return (
        <div className="card">
            <img className="card__preview" src={url} alt=""/>
            <h2 className="card__title">{title}</h2>
            <p className="card__description">
            {description}
            </p>
            <div className="card__footer">
            <div className="card__price">
            {price}
            </div>
            <button className='card__price-btn'>
                +
            </button>
            </div>

        </div>
    );
}

export default Card;
